/**
 * If you are not familiar with React Navigation, refer to the "Fundamentals" guide:
 * https://reactnavigation.org/docs/getting-started
 *
 */
import { FontAwesome } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer, DefaultTheme, DarkTheme } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as React from 'react';
import { ColorSchemeName, Pressable, TextInput, View, StyleSheet,Dimensions } from 'react-native';
import * as SplashScreen from 'expo-splash-screen';
import { useEffect, useState } from 'react';
import Colors from '../constants/Colors';
import useColorScheme from '../hooks/useColorScheme';
import ModalScreen from '../screens/ModalScreen';
import NotFoundScreen from '../screens/NotFoundScreen';
import TabOneScreen from '../screens/TabOneScreen';
import TabTwoScreen from '../screens/TabTwoScreen';
import { RootStackParamList, RootTabParamList, RootTabScreenProps } from '../types';
import LinkingConfiguration from './LinkingConfiguration';
import HistoryInfo from '../screens/HistoryInfo';
import BookmarkInfo from '../screens/Bookmark';
import { createDrawerNavigator } from '@react-navigation/drawer';
const Drawer = createDrawerNavigator();

let title = '';
const width  = Dimensions.get("screen").width
export default function Navigation({ colorScheme }: { colorScheme: ColorSchemeName }) {
  return (
    <NavigationContainer
      linking={LinkingConfiguration}
      theme={colorScheme === 'dark' ? DarkTheme : DefaultTheme}>
      <RootNavigator />

    </NavigationContainer>
  );
}


/**
 * A root stack navigator is often used for displaying modals on top of all other content.
 * https://reactnavigation.org/docs/modal
 */
const Stack = createNativeStackNavigator<RootStackParamList>();

function DrawerNavigator(){
  return (
      <Drawer.Navigator>
        <Drawer.Screen name="History" component={HistoryInfo} />
        <Drawer.Screen name="Bookmark" component={BookmarkInfo} />
      </Drawer.Navigator>
  );
}

function RootNavigator() {
  return (
    <Stack.Navigator>
       <Stack.Screen
          name="Home"
          component={DrawerNavigator}
          options={{ headerShown: false }}
        />
      <Stack.Screen name="Root" component={BottomTabNavigator} options={{ headerShown: false }} />
      <Stack.Screen name="NotFound" component={NotFoundScreen} options={{ title: 'Oops!' }} />
      <Stack.Group screenOptions={{ presentation: 'modal' }}>
        <Stack.Screen name="Modal" component={ModalScreen} options={{title: 'Search Result'}} />
      </Stack.Group>
      <Stack.Screen name="History" component={HistoryInfo} options={{title: 'History'}} />
      <Stack.Screen name="Bookmark" component={BookmarkInfo} options={{title: 'Bookmark'}} />

    </Stack.Navigator>
  );
}

/**
 * A bottom tab navigator displays tab buttons on the bottom of the display to switch screens.
 * https://reactnavigation.org/docs/bottom-tab-navigator
 */
const BottomTab = createBottomTabNavigator<RootTabParamList>();


function BottomTabNavigator() {
  const colorScheme = useColorScheme();
  const [isSearch, setSearching] = useState(false);
  const [value, setValue] = useState('');
  // const styles = StyleSheet.create({
  //   search: {}
  // })
  return (
    <BottomTab.Navigator
      initialRouteName="TabOne"
      screenOptions={{
        tabBarActiveTintColor: Colors[colorScheme].tint,
      }}>
      <BottomTab.Screen
        name="TabOne"
        component={TabOneScreen}
        options={({ navigation }: RootTabScreenProps<'TabOne'>) => ({
          title:'Từ điển Anh - Anh',
          headerTitle: !isSearch ? 'Từ điển Anh - Anh' : '',
          tabBarIcon: ({ color }) => <TabBarIcon name="book" color={color} />,
          headerLeft: () => (
            !!isSearch &&
              (
                <View style={{
                  "height": "50%",
                  "width": width,
                  "display": 'flex',
                  'flexDirection': "row"
                }}
                >
                <Pressable
                onPress={() => {
                  setSearching(false);
                }}
                style={({ pressed }) => ({
                  opacity: pressed ? 0.5 : 1,
                })}>
                <FontAwesome
                  name="arrow-left"
                  size={25}
                  color={Colors[colorScheme].text}
                  style={{ marginRight: 15, marginLeft: 10 }}
                />
              </Pressable>

                  <TextInput
                    onSubmitEditing = {() => navigation.navigate('Modal', {value: value})}
                    editable
                    placeholder='Type in the word'
                    placeholderTextColor='gray'
                    style={{
                      "borderColor": '#FFFFFF',
                      "borderWidth": 1,
                      'color': "#FFFFFF",
                      "height": "100%",
                      "width": width*0.8,
                      "padding": 5
                    }}

                    onChangeText={(text: any) => setValue(text)}
                    value={value}
                  />
                </View>
              )
          ),
          headerRight: () => (
            !isSearch &&
              <Pressable
                // onPress={() => navigation.navigate('Modal')}
                onPress={() => {
                  setSearching(true);
                  navigation.openDrawer();
                }}
                style={({ pressed }) => ({
                  opacity: pressed ? 0.5 : 1,
                })}>
                <FontAwesome
                  name="search"
                  size={25}
                  color={Colors[colorScheme].text}
                  style={{ marginRight: 15 }}
                />
              </Pressable>
          ),
        })}
      />
      <BottomTab.Screen
        name="TabTwo"
        component={TabTwoScreen}
        options={{
          title: 'Từ điển Anh - Việt',
          tabBarIcon: ({ color }) => <TabBarIcon name="book" color={color} />,
          headerRight: () => (
            <Pressable
              // onPress={() => navigation.navigate('Modal')}
              style={({ pressed }) => ({
                opacity: pressed ? 0.5 : 1,
              })}>

              <FontAwesome
                name="search"
                size={25}
                color={Colors[colorScheme].text}
                style={{ marginRight: 15 }}
              />
            </Pressable>
          ),
        }}
      />
    </BottomTab.Navigator>
  );
}

/**
 * You can explore the built-in icon families and icons on the web at https://icons.expo.fyi/
 */
function TabBarIcon(props: {
  name: React.ComponentProps<typeof FontAwesome>['name'];
  color: string;
}) {
  return <FontAwesome size={30} style={{ marginBottom: -3 }} {...props} />;
}
